import './App.css';
import Header from './Components/Header/Header';
import Footer from './Components/Footer/Footer';
import Main from './Components/Main/Main';




const Section = () => {
  return(
    <section>
     Section
    </section>
  )
}


function App() {
  return (
    <div className="App">
      <Header/>
      <Main>
       <Section/>
       <Section/>
       <Section/>
      </Main>
      <Footer/>
    </div>
  );
}

export default App;
